import React from "react";
import articles from "./Content";

const Articles = ({ match }) => {
  const name = match.params.name;
  const foundName=articles.find(article=>{
      if( article.name===name)
      return true;
  });
  console.log("Found article name"+foundName)
  const data = articles.map((data, key) => {
    const { name, title, content } = data;
    return (
      <ul>
        {name}
        <li>{title}</li>
        <li>{content}</li>
      </ul>
    );
  });
  return (
    <div>
      Articles {name}
      {data}
    </div>
  );
};
export default Articles;
